// src/components/PersonalDetails.js
import React from 'react';
import { Paper, Typography } from '@mui/material';
import { styled } from '@mui/material/styles';

const PersonalDetails = ({ details }) => {
  console.log(details); // Check the console to verify received details

  // Handle the case when details are not available or improperly passed
  if (!details || Object.keys(details).length === 0) {
    return <Typography sx={{ color: 'red' }}>Personal details are not available.</Typography>;
  }

  return (
    <StyledPaper>
      <Typography variant="h6" sx={{ color: 'teal', fontWeight: 'bold' }}>Personal Details</Typography>
      <Typography>Name: {details.name || 'N/A'}</Typography>
      <Typography>Age: {details.age || 'N/A'}</Typography>
      <Typography>Grade: {details.grade || 'N/A'}</Typography>
      <Typography>Email: {details.contact?.email || 'N/A'}</Typography>
      <Typography>Phone: {details.contact?.phone || 'N/A'}</Typography>
      <Typography>Address: {details.contact?.address || 'N/A'}</Typography>
    </StyledPaper>
  );
};

const StyledPaper = styled(Paper)({
  padding: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
});

export default PersonalDetails;
